export const actionType = { FETCH_SUCCES: "FETCH_SUCCES" };

function fetchData(comments) {
  return {
    type: "FETCH_SUCCES",
    payload: comments
  };
}
export function fetchComments() {
  return dispatch => {
    dispatch(fetchData());
  };
}
